import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Bio from '../Components/js//Biography.js';
import Homepage from './Components/js/Homepage.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Router>
          <div className="home">
            <div className="component-container"> 
                <Switch>
                    <Route path="/home">
                        <Homepage/>
                    </Route>
                    <Route path="/bio">
                        <Bio/>
                    </Route>
                    <Route path="/hobbies">

                    </Route>
                    <Route path="/contacts">

                    </Route>
                    <Route path="/performances">

                    </Route>
                    <Route path="/repertoirelist">

                    </Route>
                </Switch>
            </div>
          </div>
        </Router>
      </header>
    </div>
  );
}

export default App;
